```c
#include <stdio.h>

int main() {
    int a = 5 * 3;
    printf("The value of a is: %d\n", a);
    return 0;
}
```

2. Dead Code Elimination: This optimization technique removes code that is unreachable or never used. For example, in the following code, the `printf` statement is never executed because the value of `a` is always `0`.

```c
#include <stdio.h>

int main() {
    int a = 0;
    if (a == 0) {
        // This printf statement is never executed
        printf("a is zero\n");
    }
    return 0;
}
```

3. Strength Reduction: This optimization technique replaces complex expressions with simpler ones that have the same result. For example, in the following code, the expression `a * b * c` is replaced with `a * (b * c)`.

```c
#include <stdio.h>

int main() {
    int a = 5, b = 3, c = 2;
    int product = a * b * c;
    printf("The product is: %d\n", product);
    return 0;
}
```

