namespace TCPClient
{
    class Program
    {
        static void Main(string[] args)
        {
            try
            {
                // Create a TCP client.
                TcpClient client = new TcpClient("192.168.0.3", 40957);

                // Get a stream for reading from the server.
                NetworkStream stream = client.GetStream();

                // Send the login message.
                byte[] sendBuffer = Encoding.ASCII.GetBytes("LGIN x-stream");
                stream.Write(sendBuffer, 0, sendBuffer.Length);

                // Receive the server's response.
                byte[] receiveBuffer = new byte[1024];
                int bytesRead = stream.Read(receiveBuffer, 0, receiveBuffer.Length);
                string responseData = Encoding.ASCII.GetString(receiveBuffer, 0, bytesRead);

